import { StyleSheet, Text, TouchableOpacity, View } from 'react-native'
import React from 'react'

const  Contact = ({ navigation }) => {
  const [userName, setUserName] = useState();
  const [userPassword, setUserPassword] = useState();

  const Submit = () => {
 if (userName === "TopG" && userPassword === "1534") {
      // console.log(` WellCome  ${userName} `)
      navigation.navigate("home", { myName: `${userName}` });
    } else {
      console.log(`Wrong userName or PassWord`);
    }
  };

  // console.log(userName)
  // console.log(userPassword)
  const [agree, setAgree] = useState(false);   
  return (
    <View style={Styles.mainContainer}>
      <View style={Styles.TextContainer}>
        <Text style={Styles.LoginHeading}>LoginPage</Text>
        <Text style={Styles.LoginText}>
          You can reach us anytime malik@top-g.com
        </Text>
      </View>
      <View style={Styles.NameContainer}>
        <Text style={Styles.NameText}> Enter your name </Text>
        <TextInput
          style={Styles.NameInput}
          autoCapitalize="none"
          autoCorrect={false}
          value={userName} // its is main prop
          onChangeText={(name) => {
            setUserName(name);
          }}
        />
      </View>
      <View style={Styles.PasswordContainer}>
        <Text style={Styles.PasswordText}> Enter your password </Text>
        <TextInput
          style={Styles.PasswordInput}
          autoCapitalize="none"
          autoCorrect={false}
          secureTextEntry={true}
          value={userPassword}
          onChangeText={(password) => {
            setUserPassword(password);
          }}
        />
      </View>
      <View style={Styles.CheckboxContainer}>
        <Checkbox
          value={agree}
          onValueChange={() => {
            setAgree(!agree);
          }}
          color={agree ? "#03A9F5" : undefined}
          style={Styles.Checkbox}
        />
        <Text style={Styles.CheckboxText}>
          i have read and agrees with the TC
        </Text>
      </View>
      <TouchableOpacity
        // disabled= {agree ? false : true}
        disabled={!agree}
        style={[agree ? Styles.LoginButton : Styles.LoginBtnWTColor]}
        onPress={() => {
          Submit();
        }}
      >
        <Text
          style={[agree ? Styles.LoginBtnText : Styles.LoginBtnWTcolorText]}
        >
          Login
        </Text>
      </TouchableOpacity>
    </View>
  );
};

const styles = StyleSheet.create({})
export default Contact
